sys_variable_value.value:
function addCostRecord(outputs, result, csp, organization, portfolio, taskOrder, clinRecord, isActual) {
  var gdt = new GlideDateTime();
  gdt.setDisplayValue(result.month, "yyyy-MM");   
  // Check to see if we already have a record for this Task Order / CLIN / Year-Month Tuple
  var cost = new GlideRecord('x_g_dis_atat_costs');
  cost.addQuery("task_order_number", taskOrder.taskOrderNumber);
  cost.addQuery("clin", clinRecord.sys_id);
  cost.addQuery("year_month", gdt.getDate());
  cost.query();

  var isUpdate = false;
  if (cost.hasNext()) {
    cost.next();
    isUpdate = true;       
  }
  else {
    cost.newRecord();
    isUpdate = false;       
  }

  cost.clin = clinRecord.sys_id;
  cost.csp = csp.sys_id;
  cost.is_actual = isActual;
  cost.portfolio = portfolio.sys_id;
  cost.task_order_number = taskOrder.taskOrderNumber;
  cost.value = result.value;
  cost.year_month = gdt;
  if (organization) {
    cost.organization = organization.sys_id;
    cost.service_agency = organization.agency;
  }

  if (isUpdate) {
    cost.update();
    outputs.num_updates++;
  }
  else {
    cost.insert();
    outputs.num_creates++;
  }
}

function handleCostObject(costObject, outputs) {
  let cspName = costObject.content.request.targetCspName;
  let csp = new GlideRecord('x_g_dis_atat_cloud_service_provider');
  csp.get("name", cspName);
  if (!csp.sys_id) {
    throw "Could not find CSP with name '" + cspName + "'";
  }

  let portfolioId = costObject.content.request.portfolioId;
  let portfolio = new GlideRecord('x_g_dis_atat_portfolio');
  portfolio.get("csp_id", portfolioId);
  if (!portfolio.sys_id) {
    throw "Could not find Portfolio with ID '" + portfolioId + "'";
  }

  let organization = portfolio?.acquisition_package?.organization;
  const taskOrders = costObject.content.response.taskOrders;
  if (!taskOrders) {
    throw "No 'taskOrders' array found in response";
  }

  taskOrders.forEach(function (taskOrder) {
    // Look up Task Order object
    var taskOrderRecord = new GlideRecord('x_g_dis_atat_task_order');
    taskOrderRecord.addQuery("task_order_number", taskOrder.taskOrderNumber);
    taskOrderRecord.query();
    if (!taskOrderRecord.hasNext()) {
      throw "Could not find an existing Task Order with number " + taskOrder.taskOrderNumber;
    }
    taskOrderRecord.next();

    taskOrder.clins.forEach(function (clin) {
      // Look up CLIN object
      var clinRecord = new GlideRecord('x_g_dis_atat_clin');
      clinRecord.addQuery("clin_number", clin.clinNumber);
      clinRecord.addQuery("task_order", taskOrderRecord.sys_id);
      clinRecord.query();
      if (!clinRecord.hasNext()) {
        throw "Could not find an existing CLIN with number " + clin.clinNumber + " and Task Order Number " + taskOrder.taskOrderNumber;
      }
      clinRecord.next();      

      if (!clin?.actual?.results) {
        throw "No actuals found for this record (portfolioId: " + costObject.content.request.portfolioId + ")";
      }
      clin?.actual?.results.forEach(function (result) {        
        addCostRecord(outputs, result, csp, organization, portfolio, taskOrder, clinRecord, true);
      });

      if (!clin?.forecast?.results) {
        // Warn for missing forecasts, for now. Consider treating as error later.
        gs.warn("No forecasts found for this record - portfolioId: " + costObject.content.request.portfolioId);
      }
      else {
        clin?.forecast?.results.forEach(function (result) {        
          addCostRecord(outputs, result, csp, organization, portfolio, taskOrder, clinRecord, false);
        });             
      }
    });
  });

  const dateTime = new GlideDateTime();
  portfolio.setValue('last_cost_data_sync', dateTime.getValue());
  portfolio.update();
}

(function execute(inputs, outputs) {
  outputs.num_creates = 0;
  outputs.num_updates = 0;
  outputs.num_failures = 0;
  var costObjects = JSON.parse(inputs.cost_response);

  costObjects.forEach(function (costObject) {
    try {
      var statusCode = costObject.code;
      if (statusCode === 200) {
        // processed responses with 200; can be adjusted later based on expected codes
        handleCostObject(costObject, outputs);
      } else {
        // log errors for all other codes not 200
        // allows for the action and subflow to continue processing other responses
        var response = JSON.stringify(costObject.content.response);
        var request = JSON.stringify(costObject.content.request);

        var errorMessage = "Cost request failed with a status code of " + statusCode + ". ";
        errorMessage += "Response: " + response + ". ";
        errorMessage += "Request: " + request;
        gs.error(errorMessage);
        outputs.num_failures;
      }      
    } catch (error) {
      gs.error("Unexpected error: " + error);
      outputs.num_failures++;
    }

  });
})(inputs, outputs);

